import React, { Component } from 'react';
import Event from './Event';
//import {Consumer} from '../../context';

class Events extends Component {

state={
events:[
{
    id:1,
    name:'EventA',
    description:'descA',
    location:'Paris'
},
{
    id:2,
    name:'EventB',
    description:'descB',
    location:'Germany'
},
{
    id:3,
    name:'EventC',
    description:'descC',
    location:'Patna'
},
]

};
    render() {
        return(

            <Consumer>
                {value=>{
                    const {events} =value;
                    return (<React.Fragment>
                        <h1 className="display-4 mb-2"><span className="text-danger">Event</span> List</h1>
                        {events.map(event =>(
                            <Event 
                            key={event.id} event={event}
                            
                           />
                        ))}
                    </React.Fragment>)

                }}
            </Consumer>
        )
      
    }
}

export default Events;
